import React, { useContext } from 'react';
import { DataContext } from '../../App';

const Bester = () => {
    const movie = useContext(DataContext);
    return (
        <div>
            <h3>React Bester</h3>
            <div key={movie.id}>
                <p>Movie Name : {movie.movieName}</p>
                <p>Producer: {movie.producer}</p>
            </div>
        </div>
    );
};

export default Bester;
